document.addEventListener("DOMContentLoaded", () => {

  const productos = [
    { id: 1, nombre: "Laptop Pro", precio: 1200, categoria: "Tecnolog√≠a", imagen: "data:image/jpeg;base64," },
    { id: 2, nombre: "Cafetera Autom√°tica", precio: 80, categoria: "Hogar", imagen: "data:image/jpeg;base64," },
    { id: 3, nombre: "Auriculares Bluetooth", precio: 60, categoria: "Tecnolog√≠a", imagen: "data:image/jpeg;base64," },
    { id: 4, nombre: "Zapatillas Running", precio: 110, categoria: "Deportes", imagen: "data:image/jpeg;base64," },
    { id: 5, nombre: "Televisor 4K", precio: 900, categoria: "Tecnolog√≠a", imagen: "data:image/jpeg;base64," },
    { id: 6, nombre: "Robot Aspirador", precio: 350, categoria: "Hogar", imagen: "data:image/jpeg;base64," },
    { id: 7, nombre: "Raqueta de Tenis", precio: 90, categoria: "Deportes", imagen: "data:image/jpeg;base64," },
    { id: 8, nombre: "Smartwatch", precio: 250, categoria: "Tecnolog√≠a", imagen: "data:image/png;base64," },
    { id: 9, nombre: "Set de Cuchillos", precio: 40, categoria: "Hogar", imagen: "data:image/jpeg;base64," },
    { id: 10, nombre: "Bicicleta de Monta√±a", precio: 850, categoria: "Deportes", imagen: "data:image/jpeg;base64," }
  ];

  const contenedor = document.getElementById("productos");
  const inputBuscar = document.getElementById("buscarNombre");
  const selectCategoria = document.getElementById("categoria");
  const rangoPrecio = document.getElementById("precioMax");
  const precioValor = document.getElementById("precioValor");
  const radiosOrden = document.querySelectorAll('input[name="orden"]');


  const categoriasUnicas = ["Todas", ...new Set(productos.map(p => p.categoria))];
  categoriasUnicas.forEach(cat => {
    const option = document.createElement("option");
    option.value = cat;
    option.textContent = cat;
    selectCategoria.appendChild(option);
  });


  function renderizarProductos(lista) {
    contenedor.innerHTML = "";
    if (lista.length === 0) {
      contenedor.innerHTML = `<p class="text-center text-muted">No se encontraron productos.</p>`;
      return;
    }

    lista.forEach(prod => {
      const card = document.createElement("div");
      card.classList.add("col-md-3");

      card.innerHTML = `
        <div class="card card-producto shadow-sm">
          <img src="${prod.imagen}" class="card-img-top" alt="${prod.nombre}">
          <div class="card-body text-center">
            <h5 class="card-title">${prod.nombre}</h5>
            <p class="text-muted">${prod.categoria}</p>
            <p class="fw-bold">${prod.precio.toFixed(2)} ‚Ç¨</p>
          </div>
        </div>
      `;

      contenedor.appendChild(card);
    });
  }


  function filtrarYOrdenar() {
    let lista = [...productos];
    const texto = inputBuscar.value.toLowerCase();
    const categoria = selectCategoria.value;
    const precioMax = parseFloat(rangoPrecio.value);
    const orden = document.querySelector('input[name="orden"]:checked')?.value;

   
    if (texto) {
      lista = lista.filter(p => p.nombre.toLowerCase().includes(texto));
    }

   
    if (categoria !== "Todas") {
      lista = lista.filter(p => p.categoria === categoria);
    }


    lista = lista.filter(p => p.precio <= precioMax);

    
    if (orden === "precio-asc") lista.sort((a, b) => a.precio - b.precio);
    if (orden === "precio-desc") lista.sort((a, b) => b.precio - a.precio);
    if (orden === "nombre-asc") lista.sort((a, b) => a.nombre.localeCompare(b.nombre));

    renderizarProductos(lista);
  }


  inputBuscar.addEventListener("input", filtrarYOrdenar);
  selectCategoria.addEventListener("change", filtrarYOrdenar);
  rangoPrecio.addEventListener("input", () => {
    precioValor.textContent = rangoPrecio.value;
    filtrarYOrdenar();
  });
  radiosOrden.forEach(r => r.addEventListener("change", filtrarYOrdenar));

  renderizarProductos(productos);
});
